//Event listener Button to Calculate SGPA, CGPA, TOTAL CREDIS, STATUS
btn.addEventListener("click", function () {

    var len1 = document.querySelectorAll(".box").length
    var sgp = document.querySelectorAll(".box")
    // gradeDesign.classList.remove("displayN")
    for (var u = 2; u <= len1; u += 4) {
        for (j = u; j <= u; j += 4) {
            if (document.querySelectorAll(".box")[u].value != "") {
                document.querySelectorAll(".box")[j + 1].value = sgpa((sgp[u].value).toUpperCase())
                //console.log(j+2,u)
                // alert("callll")
            }
        }
    }
    len = document.querySelectorAll(".box").length

    for (j = 1; j <= len; j += 4) {
        totalCredit += parseInt(document.querySelectorAll(".box")[j].value)
    }

    for (u = 3; u <= len; u += 4) {
        totalGrade += parseFloat(document.querySelectorAll(".box")[u].value)
    }
    //         console.log(totalGrade)

    for (j = 1; j <= len; j += 4) {
        for (u = j; u <= j; u += 4) {
            totalCreditPoint += (parseFloat(document.querySelectorAll(".box")[u].value) * parseFloat(document.querySelectorAll(".box")[j + 2].value))
        }
    }
    lsgpa = (totalCreditPoint.toFixed(2) / totalCredit)
    lcgpa = (totalCreditPoint.toFixed(2) / totalCredit)
    lst = lcgpa.toFixed(1)

    //console.log(len)

    //console.log(totalCreditPoint)


    if (isNaN(lsgpa) || isNaN(lcgpa)) {
        alert("Please Enter the value")
        // totalCreditPoint=""               
    }
    else {//Attach GPA, CGPA, TOTAL CREDIS, STATUS
        sg.textContent = lsgpa.toFixed(2)
        cg.textContent = lcgpa.toFixed(2)
        tc.textContent = totalCredit
        st.textContent = status(lst)
        gradeDesign.classList.remove("displayN")
    } //Attach GPA, CGPA, TOTAL CREDIS, STATUS End
    totalCredit = 0
    totalCreditPoint = 0

})//Event listener Button to Calculate SGPA, CGPA, TOTAL CREDIS, STATUS End
