//Create function cheack the Grade Point
function sgpa(num) {
    if (num == "A+" || (num >= 80 && num <= 100)) {
        return 4.0
    }
     else if (num == "A+" || (num >= 75 && num <= 79)) {
        return 3.75
    }
     else if (num == "A-" || (num >= 70 && num <= 74)) {
        return 3.50
    }
    else if (num == "B+" || (num >= 65 && num <= 69)) {
        return 3.25
    }
    else if (num == "B" || (num >= 60 && num <= 64)) {
        return 3.00
    }
    else if (num == "B-" || (num >= 55 && num <= 59)) {
        return 2.75
    }
    else if (num == "C+" || (num >= 50 && num <= 54)) {
        return 2.5
    }
    else if (num == "C" || (num >= 45 && num <= 49)) {
        return 2.25
    }
    else if (num == "D" || (num >= 40 && num <= 44)) {
        return 2.0
    }
    else if (num == "F" || (num >= 0 && num < 40)) {
        return 0.0
    }
}  //Create function cheack the Grade Point End


// cheack the CGPA status
function status(possition) {
   if (possition >= 3.00 && possition <= 4.00) {
        return "1st Class"
    }
    else if (possition >= 2.25 && possition <= 2.9) {
        return "2nd Class"
    }
    else if (possition >= 2.0 && possition <= 2.25) {
        return "3rd Class"
    }
    else if (possition < 2.0) {
        return "Fail"
    } else {
        return "No Status"
    }
} // cheack the CGPA status End

//create dynamic html element----1
function dynamicElement1() {
    var tr = document.createElement('tr')


    for (i = 0; i < 4; i++) {
        var td = document.createElement('td')
        var newInput1 = document.createElement('input')
        newInput1.setAttribute("type", "text")
        newInput1.setAttribute("class", "box")
        newInput1.classList.add("designbox")

        td.appendChild(newInput1)
        tr.appendChild(td)
    }
    tr.setAttribute("class", "dbox")
    tdata.appendChild(tr);
}//create dynamic html element End     

















