//Create Dawonlode PDF function 
function addprint() {


    var doc = new jsPDF();
    var imgData = 'data:image/png;base64,';

    doc.addImage(imgData, 'JPEG', 0, 0, 210, 297);

    var sname = (uname.value).toString()
    var sid = (uid.value).toString()
    var sprogram = (uprogram.value).toString()

    var ssgpa = lsgpa.toFixed(2).toString()
    var scgpa = lcgpa.toFixed(2).toString()
    var scredit = totalCreditDoc.toString()
    var sstatus = status(lst).toString()


    doc.setFontSize(15);
    doc.setTextColor(0, 0, 0);

    doc.text(37, 58, sname);
    doc.text(31, 66, sid);
    doc.text(49, 74, sprogram);

    doc.text(100, 93, ssgpa);
    doc.text(100, 105, scgpa);
    doc.text(100, 116, scredit);
    doc.text(100, 127, sstatus);
    doc.save("CGPA_" + lsgpa.toFixed(2).toString() + ".pdf");
} //Create Dawonlode PDF function End

//---------Loading js-----------
var preloader;

function preload(opacity) {
    if (opacity <= 0) {
        showContent();
    }
    else {
        preloader.style.opacity = opacity;
        window.setTimeout(function () { preload(opacity - 0.05) }, 200);
    }
}

function showContent() {
    preloader.style.display = 'none';
    document.getElementById('content').style.display = 'block';
}

document.addEventListener("DOMContentLoaded", function () {
    preloader = document.getElementById('preloader');
    preload(1);
});

//---------Loading End-------
